sourcesContent:
import css from 'styled-jsx/css';

export default css.global`
  @font-face {
    font-family: 'Molot';
    src: url('/fonts/Molot/MolotRegular/MolotRegular.woff') format('woff'),
      url('/fonts/Molot/MolotRegular/MolotRegular.ttf') format('ttf'),
      url('/fonts/Molot/MolotRegular/MolotRegular.eot') format('eot');
    font-weight: 700;
    font-style: bold;
  }
  @font-face {
    font-family: 'MuseoSans';
    src: url('/fonts/MuseoSans/MuseoSansBold/MuseoSansBold.woff') format('woff'),
      url('/fonts/MuseoSans/MuseoSansBold/MuseoSansBold.ttf') format('ttf'),
      url('/fonts/MuseoSans/MuseoSansBold/MuseoSansBold.eot') format('eot');
    font-weight: 700;
    font-style: bold;
  }
  @font-face {
    font-family: 'MuseoSans';
    src: url('/fonts/MuseoSans/MuseoSansBlack/MuseoSansBlack.woff')
        format('woff'),
      url('/fonts/MuseoSans/MuseoSansBlack/MuseoSansBlack.ttf') format('ttf'),
      url('/fonts/MuseoSans/MuseoSansBlack/MuseoSansBlack.eot') format('eot');
    font-weight: 900;
    font-style: black;
  }
  @font-face {
    font-family: 'MuseoSans';
    src: url('/fonts/MuseoSans/MuseoSansMedium/MuseoSansMedium.woff')
        format('woff'),
      url('/fonts/MuseoSans/MuseoSansMedium/MuseoSansMedium.ttf') format('ttf'),
      url('/fonts/MuseoSans/MuseoSansMedium/MuseoSansMedium.eot') format('eot');
    font-weight: 500;
    font-style: medium;
  }
  @font-face {
    font-family: 'MuseoSans';
    src: url('/fonts/MuseoSans/MuseoSansRegular/MuseoSansRegular.woff')
        format('woff'),
      url('/fonts/MuseoSans/MuseoSansRegular/MuseoSansRegular.ttf')
        format('ttf'),
      url('/fonts/MuseoSans/MuseoSansRegular/MuseoSansRegular.eot')
        format('eot');
    font-weight: 300;
    font-style: bold;
  }
  @font-face {
    font-family: 'MuseoSans';
    src: url('/fonts/MuseoSans/MuseoSansItalic/MuseoSansItalic.woff')
        format('woff'),
      url('/fonts/MuseoSans/MuseoSansItalic/MuseoSansItalic.ttf') format('ttf'),
      url('/fonts/MuseoSans/MuseoSansItalic/MuseoSansItalic.eot') format('eot');
    font-weight: 500;
    font-style: italic;
  }

  body,
  html {
    --noto-font: 'MuseoSans', sans-serif;
    --molot-font: 'Molot', serif;
    --accent: #b3a764;
    --accent-red: rgb(245, 61, 64);
    --orange-color: rgb(242, 125, 14);
    --accent-dark: #3f3f3f;
    --l-grey: #e1e1e1;
    --sub-color: #9b9b9b;
    --wall-color: #ebebeb;
    --accent-grey: #727272;
    --text: #333;
    --border-radius: 7px;
    --new-gradient: linear-gradient(
      to right,
      rgb(242, 125, 14) 0%,
      rgb(237, 27, 61) 100%
    );

    --yel-red-gradient: linear-gradient(to right, #eecf32 0%, #c22328 100%);
    --red-gradient: linear-gradient(to left, #dc4622 0%, #b63b1d 100%);

    --card-shadow: 3px 3px 2px rgba(0, 0, 0, 0.1),
      -3px 3px 2px rgba(0, 0, 0, 0.1);
    --box-shadow: 3px 3px 4px rgba(0, 0, 0, 0.25);
    --box-shadow-up: 5px 23px 20px -15px rgba(0, 0, 0, 0.35);
    font-family: var(--noto-font);
    background: #fafafa;
    min-height: 100vh;
  }

  p {
    margin: 0;
    padding: 0;
  }
  nav {
    text-align: center;
    padding-top: 5px;
  }
  ul {
    display: flex;
    justify-content: space-between;
  }
  nav > ul {
    padding: 4px 16px;
  }
  li {
    display: flex;
    padding: 6px 8px;
  }
  a {
    color: #c94f28;
    text-decoration: none;
    font-size: 13px;
  }
  a:hover {
    text-decoration: none;
    color: #cb4828;
  }
  b {
    font-weight: 700;
  }
  .header-block {
    height: 71px;
  }

  body::-webkit-scrollbar {
    width: 1.2em;
  }

  body::-webkit-scrollbar-track {
    -webkit-box-shadow: inset 0px 0 3px rgba(0, 0, 0, 0.2);
    background-color: #a8a8a8;
  }

  body::-webkit-scrollbar-thumb {
    background-color: #fafafa;
    box-shadow: 0px 10px 5px -5px rgba(0, 0, 0, 0.2),
      0px -7px 5px -5px rgba(255, 0, 0, 0.2);
    border-radius: 3px;
    outline: 1px solid slategrey;
  }

  .home {
    display: flex;
    flex-direction: column;
  }
  .button-grey-container {
    margin-top: 30px;
  }
  .button-grey-container .button-grey {
    position: relative;
    text-decoration: none;
    cursor: pointer;
    padding: 0;
    display: block;
    font-weight: 300;
    text-align: center;
    width: 170px;
    height: 50px;
    border-radius: 30px;
    background-color: var(--accent-red);
    color: #ffffff;
    font-size: 16px;
    line-height: 50px;
    margin: 0 auto;
    box-shadow: var(--box-shadow-up);
    transition: box-shadow 0.2s ease-in;
    z-index: 1;
  }
  .button-grey-container .button-grey:hover {
    box-shadow: var(--box-shadow);
  }
  .button-grey-container .button-grey:active {
    box-shadow: 0px 0px 3px rgba(0, 0, 0, 0.45);
  }
  .button-grey-container .arenda-button {
    position: relative;
    text-decoration: none;
    cursor: pointer;
    padding: 0;
    display: block;
    font-weight: 300;
    text-align: center;
    width: 170px;
    height: 40px;
    border-radius: 30px;
    background: rgba(255, 255, 255, 0.05);
    color: #6d6d6d;
    font-size: 16px;
    line-height: 40px;
    margin: 0 0 0 30px;
    box-shadow: 0 0 3px rgba(0, 0, 0, 0.2);
    transition: all 0.2s ease-in;
  }
  .button-grey-container .arenda-button:hover {
    background: rgba(255, 255, 255, 1);
    box-shadow: 0 0 15px rgba(0, 0, 0, 0.1);
  }

  .button-container {
    position: relative;
    z-index: 1;
  }
  .button-container .button-min {
    z-index: 0;
    display: block;
    position: absolute;
    width: 50px;
    height: 50px;
    bottom: 0;
    right: 0;
    border-top-left-radius: 15px;
    background-color: var(--accent-red);
    box-shadow: inset 5px 5px 7px rgba(0, 0, 0, 0.5);
    transition: all 0.2s ease-in;
  }
  .button-container .button-min::before {
    position: absolute;
    display: block;
    content: '';
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%) rotateZ(45deg);
    width: 11px;
    height: 11px;
    background-color: rgba(0, 0, 0, 0);
    border-top: 2px solid white;
    border-right: 2px solid white;
  }
  .button-container .button-min:hover {
    width: 90px;
  }
  .header-common {
    font-family: var(--noto-font);
    color: #7e7e7e;
    display: block;
    font-size: 15px;
    font-weight: 500;
    line-height: 24px;
    text-align: center;
    margin-top: 30px;
  }
  .header-red {
    font-family: var(--noto-font);
    display: block;
    font-size: 23px;
    font-weight: 700;
    line-height: 26px;
    margin-bottom: 20px;
    letter-spacing: -0.15px;
  }
  .header-razdel {
    font-size: 20px;
    font-weight: 700;
    line-height: 30px;
    letter-spacing: -0.6px;
  }

  .header-min-colored {
    font-family: var(--molot-font);
    font-size: 21px;
    font-weight: 700;
    letter-spacing: -0.2px;
    color: #474747;
    line-height: 24px;
  }
  .header-sections {
    font-family: var(--noto-font);
    color: #7e7e7e;
    display: block;
    font-size: 17px;
    font-weight: 500;
    line-height: 24px;
    text-align: center;
    margin-top: 30px;
    margin-bottom: 30px;
  }

  .subheading-common {
    display: block;
    font-family: var(--noto-font);
    color: #313131;
    font-size: 14px;
    line-height: 24px;
    margin-bottom: 30px;
    margin-top: 40px;
  }
  .subheading-common-2 {
    display: block;
    color: rgb(82, 82, 82);
    font-size: 14px;
    line-height: 24px;
    margin-bottom: 15px;
    margin-top: 15px;
    font-weight: 700;
    padding-left: 15px;
    padding-right: 15px;
  }
  .subheading-common-3 {
    display: block;
    color: #313131;
    font-size: 15px;
    letter-spacing: -0.3px;
    font-weight: 300;
    line-height: 25px;
    margin-bottom: 30px;
    padding-left: 15px;
    padding-right: 15px;
  }
  .subheading-red-bottom {
    color: var(--accent-red);
    display: block;
    margin-bottom: 30px;
    font-weight: 700;
  }
  .subheading-red-top {
    color: var(--accent-red);
    display: block;
    margin-top: 30px;
    font-weight: 700;
  }
  .text-common {
    display: block;
    font-family: var(--noto-font);
    color: #3b3b3b;
    font-size: 14px;
    font-weight: 400;
    line-height: 22px;
    letter-spacing: -0.35px;
    margin-bottom: 0px;
  }
  .text {
    display: block;
    font-family: var(--noto-font);
    color: #535353;
    font-size: 15px;
    font-weight: 300;
    line-height: 23px;
    margin-bottom: 0px;
  }
  .text-min {
    display: block;
    font-family: var(--noto-font);
    color: #3b3b3b;
    font-size: 14px;
    font-weight: 300;
    line-height: 20px;
    margin-bottom: 0px;
  }
  .text-bold {
    display: block;
    font-family: var(--noto-font);
    color: #313131;
    font-size: 15px;
    font-weight: 900;
    line-height: 22px;
  }
  .text-italic {
    font-family: var(--noto-font);
    font-style: italic;
    font-size: 15px;
    line-height: 17px;
  }
  .text-black {
    color: #353535;
  }
  .section-plate {
    margin: 7px auto 7px;
    padding: 0 15px;
  }
  .bg-container {
    background-color: #e5e5e5;
    border: 1px solid #dcdcdc;
    border-radius: 3px;
  }
  .breadcrumbs {
    margin-top: 15px;
    margin-bottom: 12px;
    margin-left: 15px;
    font-family: var(--molot-font);
    line-height: 15px;
  }
  .breadcrumbs .crambs {
    display: inline-block;
    font-size: 13px;
    font-weight: 500;
    text-transform: uppercase;
    padding-right: 3px;
    color: #3f3f3f;
    letter-spacing: 0.5px;
  }
  .breadcrumbs .cramb-main {
    color: var(--accent-red);
  }
  .mycontainer {
    width: 100%;
  }
  .color-section {
    background: #fff;
    box-shadow: 0 0 15px rgba(0, 0, 0, 0.075);
  }
  .white-section {
    background-color: #fff;
  }
`;
